INSERT INTO `wp_posts` VALUES (156,1,'2021-04-05 23:11:05','2021-04-05 23:11:05','<h2> Beneficios para las empresas de tener una tienda online</h2>\n<ul>\n 	<li><strong>Alcance global</strong>: el comercio electrónico permite eliminar fronteras geográficas a bajo costo y rápidamente.</li>\n 	<li><strong>Reducción de costes</strong>: la implementación de una tienda electrónica es mucho menor que la implementación de una tienda física.</li>\n 	<li><strong>El negocio está siempre disponible</strong>: las soluciones de comercio electrónico permiten disponibilidades 7 días a la semana, 24 horas al día a un coste bajo.</li>\n 	<li><strong>Personalización</strong>: la personalización del tratamiento de los clientes se logra de manera rápida y eficiente.</li>\n 	<li><strong>Mercado de nicho</strong>: las empresas pueden atender por medios digitales de manera eficiente y a bajo coste clientes con características muy especiales (mercados de nicho).</li>\n 	<li><strong>Innovación</strong>: el comercio electrónico facilita el conocimiento del cliente y la innovación en la organización.</li>\n 	<li><strong>Prueba de productos</strong>: se pueden probar nuevos productos a través de campañas o encuestas, llegando un número muy amplio de potenciales clientes y a costes muy reducidos.</li>\n</ul>\n&nbsp;\n<ul>\n 	<li><strong>Bajos costes de comunicación</strong>: las empresas utilizando Internet como canal de comunicación logran bajar de manera significativa sus costes.</li>\n 	<li><strong>Eficiencia en las compras</strong>: se logran eficiencias importantes en los procesos de compras de las empresas cuando se utiliza Internet.</li>\n 	<li><strong>Conocimiento del cliente</strong>: se puede conocer mejor a los clientes lo que facilitará la satisfacción de sus necesidades y expectativas.</li>\n 	<li><strong>Mejora el servicio al cliente</strong>: se mejora la calidad, la eficiencia y los costes del proceso de servicio al cliente.</li>\n 	<li><strong>Bajos inventarios</strong>: el comercio electrónico le permite a las empresas minimizar los inventarios.</li>\n 	<li><strong>Distribución de productos digitales</strong>: el coste de distribución de productos digitales se reduce hasta en un 90%.</li>\n 	<li><strong>Reto a la cadena de intermediación</strong>: algunas veces los productores pueden vender sus productos a los consumidores, sin utilizar la cadena de intermediación.</li>\n 	<li><strong>Economía de red</strong>: Internet crece todos los días por lo que es más valiosa cada día ya que una red es más valiosa mientras más integrantes tenga.</li>\n 	<li><strong>Aliados que facilitan la adopción</strong>: las empresas que ingresen al comercio electrónico contarán con aliados para facilitar el proceso, desde el envío a la puerta de cliente, pasando por virutas de papel​, hasta la caja para envío postales.</li>\n</ul>\n<!--more-->\n<h2> Beneficios para los consumidores del comercio electrónico</h2>\n<ul>\n 	<li><strong>Ubicuidad</strong>: el cliente puede estar localizado en cualquier parte con acceso a Internet y podrá realizar la transacción.</li>\n 	<li><strong>Más productos y servicios</strong>: existe una gran variedad de productos y servicios disponibles en Internet.</li>\n 	<li><strong>Productos personalizados</strong>: la personalización de productos o servicios es muy común en los sitios de comercio electrónico.</li>\n 	<li><strong>Productos o servicios al mejor precio</strong>: el consumidor puede comparar precios de los productos o servicios para comprar el que más le convenga.</li>\n 	<li><strong>Envío inmediato</strong>: los productos digitales son entregados de manera inmediata.</li>\n 	<li><strong>Información disponible</strong>: el cliente tiene mucha información a su disposición de los productos y servicios que está interesado en comprar.</li>\n 	<li><strong>Compartir su experiencia</strong>: puede utilizar internet y las redes sociales para comunicar su experiencia de compra.</li>\n 	<li><strong>Artículos poco comerciales</strong>: puede encontrar artículos que por su baja rotación no se venden en las tiendas físicas.</li>\n 	<li><strong>Rastreo de los pedidos</strong>: los consumidores tienen la posibilidad de hacer seguimiento a sus pedidos a través de medios digitales.</li>\n</ul>\n. <a class=\"boton boton-primario boton-enlace\" href=\"https://pe.wordpress.org/themes/browse/new/\" target=\"_blank\" rel=\"noopener\">VER EJEMPLOS</a>','Tiendas virtuales (eComerce y Woocomerce)','','inherit','closed','closed','','58-autosave-v1','','','2021-04-05 23:11:05','2021-04-05 23:11:05','',58,'http://localhost:10004/?p=156',0,'revision','',0);
